const Login = () => {
  const [user, setUser] = useState('');
  const [password, setPassword] = useState('');

  //const auth = getAuth();  



  return (
    <View style={tw`bg-slate-900 h-full w-full items-center`}> 
      <View style={tw`w-7/12 h-3/6 border-2 border-gray-700 bg-gray-200 mt-30 pt-10 items-center`}>
